    import React, { useState, useEffect } from 'react';
    import { Link, useNavigate } from 'react-router-dom';
    import { getActivities, addActivity } from '../services/activityService';

    const ActivityPage = () => {
    const [activities, setActivities] = useState([]);
    const [newActivity, setNewActivity] = useState({ title: '', image: '' });
    const navigate = useNavigate();

    useEffect(() => {
        loadActivities();
    }, []);

    const loadActivities = async () => {
        const loadedActivities = await getActivities();
        setActivities(loadedActivities);
    };

    const handleAddActivity = async (type) => {
        // Lógica para agregar actividad según el tipo (link, photo, note)
        // Por ahora, solo agregaremos una actividad genérica
        const newActivityData = { ...newActivity, addedBy: 'Usuario', daysAgo: 0 };
        await addActivity(newActivityData);
        setNewActivity({ title: '', image: '' });
        loadActivities();
    };

    return (
        <div className="container mx-auto px-4 py-8">
        <div className="flex justify-between items-center mb-6">
            <h1 className="text-3xl font-bold">Lindsay & Jeff's Wish List</h1>
            <Link to="/" className="text-blue-500 hover:text-blue-600">Volver al Inicio</Link>
        </div>

        <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
            <div>
            {activities.map((activity) => (
                <div key={activity.id} className="flex items-center mb-4">
                <img src={activity.image} alt={activity.title} className="w-16 h-16 object-cover rounded-lg mr-4" />
                <div>
                    <h2 className="text-xl font-semibold">{activity.title}</h2>
                    <p className="text-gray-600">Added by {activity.addedBy} {activity.daysAgo} days ago</p>
                </div>
                <button className="ml-auto text-gray-400">...</button>
                </div>
            ))}
            </div>

            <div className="bg-gray-100 p-6 rounded-lg">
            <h2 className="text-2xl font-bold mb-4">Add a Wish</h2>
            <div className="space-y-4">
                <button onClick={() => handleAddActivity('link')} className="flex items-center w-full bg-white p-3 rounded-lg hover:bg-gray-50">
                <svg className="w-6 h-6 mr-2" fill="none" stroke="currentColor" viewBox="0 0 24 24" xmlns="http://www.w3.org/2000/svg">
                    <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M13.828 10.172a4 4 0 00-5.656 0l-4 4a4 4 0 105.656 5.656l1.102-1.101m-.758-4.899a4 4 0 005.656 0l4-4a4 4 0 00-5.656-5.656l-1.1 1.1" />
                </svg>
                <span>Paste a link</span>
                <p className="ml-auto text-gray-500">Add a link to your favorite products or anything else you'd like</p>
                </button>
                <button onClick={() => handleAddActivity('photo')} className="flex items-center w-full bg-white p-3 rounded-lg hover:bg-gray-50">
                <svg className="w-6 h-6 mr-2" fill="none" stroke="currentColor" viewBox="0 0 24 24" xmlns="http://www.w3.org/2000/svg">
                    <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M3 9a2 2 0 012-2h.93a2 2 0 001.664-.89l.812-1.22A2 2 0 0110.07 4h3.86a2 2 0 011.664.89l.812 1.22A2 2 0 0018.07 7H19a2 2 0 012 2v9a2 2 0 01-2 2H5a2 2 0 01-2-2V9z" />
                    <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M15 13a3 3 0 11-6 0 3 3 0 016 0z" />
                </svg>
                <span>Take a photo</span>
                <p className="ml-auto text-gray-500">Add a photo of something you want</p>
                </button>
                <button onClick={() => handleAddActivity('note')} className="flex items-center w-full bg-white p-3 rounded-lg hover:bg-gray-50">
                <svg className="w-6 h-6 mr-2" fill="none" stroke="currentColor" viewBox="0 0 24 24" xmlns="http://www.w3.org/2000/svg">
                    <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M11 5H6a2 2 0 00-2 2v11a2 2 0 002 2h11a2 2 0 002-2v-5m-1.414-9.414a2 2 0 112.828 2.828L11.828 15H9v-2.828l8.586-8.586z" />
                </svg>
                <span>Write a note</span>
                <p className="ml-auto text-gray-500">Describe what you'd like</p>
                </button>
            </div>
            <div className="mt-4 flex justify-end space-x-4">
                <button className="px-4 py-2 border border-gray-300 rounded-lg hover:bg-gray-100">Cancel</button>
                <button className="px-4 py-2 bg-blue-500 text-white rounded-lg hover:bg-blue-600">Save</button>
            </div>
            </div>
        </div>
        </div>
    );
    };

    export default ActivityPage;
